CODE_ANIMATION SEGMENT PARA PUBLIC 'code'
    ASSUME CS:CODE_ANIMATION,DS:DATA_ANIMATION
    PUBLIC ANIMATION
ANIMATION PROC FAR
    PUSH AX
    PUSH BX
    PUSH CX
    PUSH DX
    PUSH DS
    PUSH ES
    PUSH SI
    PUSH DI

    MOV AX,0003H
    INT 10H
    
    MOV AX,1003H
	MOV BL,0
	INT 10H

    MOV SI,OFFSET SRC
    MOV DI,0

    MOV AX,DATA_ANIMATION
    MOV DS,AX

    MOV AX,0B800H
    MOV ES,AX

WRITE_IMG:
    MOV AL,220
    STOSB

    LODSB
    STOSB

    MOV AH,11H
    INT 16H
    JNZ QUIT

    CMP SI,OFFSET SRC_END-OFFSET SRC
    JE GOBACK

    CMP DI,4000
    JE NEXTF

    JMP WRITE_IMG

NEXTF:
    SLEEP 1,6000H

    MOV DI,0
    MOV AX,SI
    ADD AX,2000
    MOV SI,AX
    JMP WRITE_IMG

GOBACK:
    MOV SI,OFFSET SRC
    MOV DI,0
    JMP WRITE_IMG

QUIT:
    MOV AH,10H 
    INT 16H

    POP DI
    POP SI
    POP ES
    POP DS
    POP DX
    POP CX
    POP BX
    POP AX
    RET
ANIMATION ENDP
CODE_ANIMATION ENDS
